import { Component } from "react"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faUser,faFile,faPencilAlt,faCamera,faAngleRight} from '@fortawesome/fontawesome-free-solid'



class Resume extends Component{
 
render(){



    return(   
        <div style={{justifyContent:"center",display:"flex",marginTop:"3em"}}>
       <div className="col-sm-8 resume-container" >

       <span></span><FontAwesomeIcon icon={faUser} /> Resume Opjective
       </div>
      </div>
      )
        
    
}
}


export default Resume
